import React, { useState, useEffect } from "react";

import { useHistory } from "react-router-dom";

const HoverMenu = ({ menu  }) => {
    // const history = useHistory();

    return ( 
        <>
        <div className="text-white">
            {menu.map((item)=>{
                return (
                    <div>{item}</div>
                )
            })

            }
        </div>


        </>
    )

}
export default HoverMenu;
